import React from 'react'
import {BrowserRouter, Route, Switch} from "react-router-dom"



const Routes = () => {
    return (
        <div>
            <BrowserRouter>
            <Switch>
                <Route path="/sagar" component={Sagar} />
            </Switch>
            </BrowserRouter>
        </div>
    )
}

export default Routes;
